import './css/PreviewImg.css';

function PreviewImg(){
    return(
      <div className="previewImgContainer">
      <div className="previewImgBox">
        <h2><i class="fas fa-exclamation-circle"/>페이지를 나가시겠습니까?</h2>
        <br/>
        <p>페이지를 나가면 내용이 저장되지 아니옵니다.</p>
      </div>
    </div>
    )

  }

export default PreviewImg;
